import React from 'react';
import s from './Friend.module.css';

const Friend = (props) => {
    return (
        (<div>
            <img  className={s.ava} src = {props.src} />
            <div className={s.name}>
                {props.name}
            </div>
            </div>
        )
    );
}

export default Friend;
